    return (
        <PlaylistCardContainer>
            <button onClick={() => props.mudarPagina("playlistDetail")}>Abrir Playlist</button>
            <p>{props.name}</p>
            <p>x</p>
        </PlaylistCardContainer>
    );
}

export default PlaylistCard
